    var id = 0;

    function get_id(symbol){
      if (symbol === "chocolate"){
        id = 0;
  }
      else{
        id = 1;}
      return id;
    }

    return (
      <>
      <section className="Tile">
        <p id="p_tile">{props.symbol}</p>
      </section>
      <section className="Tile">
        <p> {props.symbol}</p>
        <img src={urls[get_id(`${props.symbol}`)]} alt="img" className='img_tile' width={100}></img>
